// SPDX-License-Identifier: MIT
pragma solidity ^0.5.0;

contract Pets {

    address[16] public adopters;

    struct Pet {
        uint id;
        string name;
        string age; 
        address owner; 
        bool isAdopted;
        string species;
        string breed;
        string picture;
    }

    Pet[] public availablePets;

    function addPet(string calldata _name, string calldata _age, string calldata _species, string calldata _breed, string calldata _picture) external 
    {
        uint size = availablePets.length;
        availablePets.push(Pet({id: size, name : _name, age: _age, species: _species, breed: _breed, picture: _picture, isAdopted: false , owner: msg.sender}));
    }

    function getPet(uint index) external view returns (string memory name, string memory age, string memory species, string memory breed, string memory picture, bool isAdopted, address owner)
    {
        Pet storage pet = availablePets[index];
        return (pet.name, pet.age, pet.species, pet.breed, pet.picture, pet.isAdopted, pet.owner);
    }

    // Adopting a pet
    function adopt(uint petId) public returns (uint) {
    require(petId >= 0 && petId <= 6);

    adopters[petId] = msg.sender;
    availablePets[petId].owner = adopters[petId];

    return petId;
    }

    // Retrieving the adopters
    function getAdopters() public view returns (address[16] memory) {
    return adopters;
    }

}
